    t[42013] = "<p>Bei der Ein-Punkt-Verteilung handelt es sich um <b>keine Wahrscheinlichkeitsverteilung im eigentlichen Sinne</b>. W\u00e4hrend normale Wahrscheinlichkeitsverteilung stets einen (verschiedenen) zuf\u00e4lligen Wert liefern, liefert die Ein-Punkt-Verteilung stets den einen, eingestellten Wert zur\u00fcck.</p>\n<p>Das bedeutet, die Ein-Punkt-Verteilung ist <b>deterministisch.</p>\n<p>Der Sinn der Ein-Punkt-Verteilung besteht darin, dass mit ihr konstante Bediendauern usw. modelliert werden k\u00f6nnen, ohne dabei von der Notation der Wahrscheinlichkeitsverteilungen abweichen zu m\u00fcssen.</p>";
